class Solution1 {
public:
	void moveZeroes(std::vector<int>& nums) {
		size_t i1{0};

		// Find first zero
		while (nums[i1] != 0) {
			++i1;
			if (i1 == nums.size()) return;
		}

		// Swap beginning of zero block with next non-zero value
		auto i2{i1 + 1};
		while (i2 != nums.size()) {
			if (nums[i2] != 0) {
				auto swap{nums[i2]};
				nums[i2] = nums[i1];
				nums[i1] = swap;
				++i1;
			}
			++i2;
		}
		return;
	}
};

// Solution 1 with iterators instead
class Solution1i {
public:
	void moveZeroes(std::vector<int>& nums) {
		auto i1{nums.begin()};
	
		// Find first zero
		while (*i1 != 0) {
			++i1;
			if (i1 == nums.end()) return;
		}

		// Swap beginning of zero block with next non-zero value
		auto i2{i1 + 1};
		while (i2 != nums.end()) {
			if (*i2 != 0) {
				auto swap{*i2};
				*i2 = *i1;
				*i1 = swap;
				++i1;
			}
			++i2;
		}
		return;
	}
};

class Solution2 {
public:
	void moveZeroes(std::vector<int>& nums) {
		auto end_non_zeros{0};  // End of non-zero section

		// Pull all non-zero elements to front
		for (auto i{0}; i != nums.size(); ++i) {
			if (nums[i] != 0) {
				nums[end_non_zeros] = nums[i];
				++end_non_zeros;
			}
		}

		// Fill end section with zeros
		while (end_non_zeros != nums.size()) {
			nums[end_non_zeros] = 0;
			++end_non_zeros;
		}
		return;
	}
};

// Solution 2 with iterators instead
class Solution2i {
public:
	void moveZeroes(std::vector<int>& nums) {
		auto end_non_zeros{nums.begin()};  // End of non-zero section

		// Pull all non-zero elements to front
		for (auto i{nums.begin()}; i != nums.end(); ++i) {
			if (*i != 0) {
				*end_non_zeros = *i;
				++end_non_zeros;
			}
		}

		// Fill end section with zeros
		std::fill(end_non_zeros, nums.end(), 0);
		return;
	}
};

